Create Model

model &lt;- rand_forest(
  mtry=tune(), trees=1000, min_n=tune()
) |&gt; set_engine(
  "ranger", num.threads=8
) |&gt; set_mode("classification")

Create Recipe

recipe &lt;- recipe(Survived ~ ., data=split_data) |&gt;
  step_impute_knn(
    Age, 
    impute_with=imp_vars(Sex, Family)
  ) |&gt; 
  step_impute_knn(
    Fare, Embarked, 
    impute_with=imp_vars(Pclass, Ticket)
  )

Create Workflow

workflow &lt;- workflow() |&gt;
  add_recipe(recipe) |&gt;
  add_model(model)

Create Model

model &lt;- boost_tree(
  mtry=tune(), trees=1000, min_n=tune(),
  tree_depth=10, learn_rate=0.01) |&gt;
  set_engine("xgboost", nthread=8, counts=FALSE) |&gt;
  set_mode("regression")

Create Recipe

recipe &lt;- recipe(SalePrice ~ ., data=split_data) |&gt;
  step_impute_knn(
    MSZoning, LotFrontage, Electrical,
    impute_with=imp_vars(
      MSSubClass, Neighborhood
    )
  ) |&gt;
  step_impute_knn(
    Exterior1st, Exterior2nd, MasVnrType,
    impute_with=imp_vars(
      MasVnrArea, ExterQual, ExterCond
    )
  ) |&gt;
  step_impute_knn(
    BsmtQual, BsmtCond, BsmtExposure, BsmtFinType2, BsmtFullBath,
    impute_with=imp_vars(
      BsmtFinType1, BsmtFinSF1, BsmtUnfSF, TotalBsmtSF
    )
  ) |&gt;
  step_impute_knn(
    GarageYrBlt, GarageFinish, GarageCars, GarageArea, GarageQual, GarageCond,
    impute_with=imp_vars(GarageType)
  ) |&gt;
  step_impute_knn(
    KitchenQual,
    impute_with=imp_vars(KitchenAbvGr)
  ) |&gt;
  step_impute_knn(
    SaleType,
    impute_with=imp_vars(SaleCondition)
  ) |&gt;
  step_dummy(
    all_nominal_predictors(),
    one_hot=TRUE
  )

Create Workflow

workflow &lt;- workflow() |&gt;
  add_recipe(recipe) |&gt;
  add_model(model)

Test Model

fit &lt;- final |&gt; fit(train_data)
predict &lt;- fit |&gt; predict(test_data) |&gt;
  rename(SalePrice=.pred) |&gt;
  mutate(SalePrice=10^SalePrice |&gt; round(0))
submission &lt;- test_id |&gt; 
  select(Id) |&gt;
  bind_cols(predict)
glimpse(submission)

